column2:
Игра не заканчивается перед третьим туром, так что я думаю это бессмысленно, чтобы говорить о штрафных санкциях, прежде чем игра фактически закончилась...'{nl}
QUEST_JOBSTEP_20150317_000778	Признавая, что он уже выиграл два раунда и не было оснований для отказа третьего, а также тот факт, что игра была конечно не закончена, Румпельштильцхен не имел никакого выбора, кроме как соблюдать Лидия Schaffen слова.{nl}и так финальный раунд начался, Лидия Schaffen судить ее последнего стрелка и крикнул когда она натянула тетиву:{nl}'моя цель... Луна в небе!'{nl}Румпельштильцхен сторону оседланных стрелку, как только она покинула тетиву, и в скором времени, он понял, что он услышал.
QUEST_JOBSTEP_20150317_000779	И, как он ехал на стрелку к Луне, Румпельштильцхен также осознал тот факт, что игра не закончится, пока он достигнет этого.{nl}как прошло время, сила стрелка утихла и она начала падать на землю. Однако, через некоторое время стрелка, что Румпельштильцхен ехал на вившееся, плавающие в небе.{nl}
QUEST_JOBSTEP_20150317_000780	Просто как Румпельштильцхен, стиснув зубы, собиралась открывать свой рот, Лидия Schaffen сказал: {nl}'закончить игру, вы должны ездить на стрелку, пока она не прибудет в створ. Игра не может закончиться раньше. Если вам удастся коснулся Луны и вернется, то я обязательно принимаю казнь.{nl}сказав так, Лидия Schaffen начал уходить, как Румпельштильцхен смотрел, стиснув зубы в очередной раз, не в состоянии изменить ход игры.

